// Home.js
import React, { useState, useEffect } from "react";
import "./Home.css";
import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();

  const [events, setEvents] = useState([]);

  // Fetch events from the server
  useEffect(() => {
    const fetchEvents = async () => {
      try {
        const response = await fetch("/api/home/events");
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const data = await response.json();
        console.log("Fetched events:", data); // Debug fetched data
        setEvents(data); // Update state
      } catch (error) {
        console.error("Error fetching events:", error);
      }
    };

    fetchEvents();
  }, []);



  return (
    <div className="home-container">
      <div className="navbar">
        <div className="nav-left">
          <button onClick={() => navigate("/")}>Home</button>
          <button onClick={() => navigate("/about")}>About</button>
          <button onClick={() => navigate("/contact")}>Contact</button>
        </div>
        <div className="nav-right">
          <button onClick={() => navigate("/profile")}>Profile</button>
        </div>
      </div>

      <div className="content">
      <div className="events-container">
  {events.length > 0 ? (
    events.map((event) => (
      <div className="event-card" key={event.id}>
        <div className="event-header">
          <p className="event-rate">{event.rate}</p>
          <button className="bookmark-btn">ðŸ”–</button>
        </div>
        <h3 className="event-title">{event.title}</h3>
        <div className="event-footer">
          <img src={event.logo} alt={`${event.company} logo`} className="event-logo" />
          <p className="event-company">{event.company}</p>
          <button className="view-btn" onClick={() => navigate(`/event/${event.id}`)}>View</button>

        </div>
      </div>
    ))
  ) : (
    <p>Loading events...</p>
  )}
</div>


      </div>
    </div>
  );
};

export default Home;
